import React, { Component } from 'react';
import OrderItem from '../OrderItem';

const data = {
    id:1,
    shop:'yuanluochuangyicai',
    picture:"",
    product:"baixiangguolengyin1zha",
    price:19.9,
    ifCommented:true,
}

class OrderList extends Component {
    render() {
        return (
            <div>
                <OrderItem data={data}/>
            </div>
        );
    }
}

export default OrderList;
